syntax = "proto3";
option java_package = "emu.grasscutter.net.proto";


message PingReq {
    bytes PDHFGJIBCLA = 13;
    bytes IINPBFLAEEP = 2;
    uint64 NHLLKPHMFGP = 3;
    double total_tick_time = 7;
    uint32 client_time = 4;
    float ue_time = 8;
    uint32 DFALBBBCFMO = 10;
    uint32 seq = 15;
}
